import React,{Component} from 'react';

import './App.css';
class TodoList extends Component{
    constructor(props){
        super (props);
        this.state={
            todos:[]
        }

    }
    componentWillMount() {
    }

    render(){
        return (
            <h1>Todo List!</h1>
        )
    }

}
//ES6 features (default is only for one class)
export default TodoList;
